function CambiamentoVisibilitPagina()
{
    if(document.hidden)
    {
        if(TimerLampeggioSpia != null) { clearTimeout(TimerLampeggioSpia); TimerLampeggioSpia = null; }
        if(TimerAggiornaCountdown != null) { clearTimeout(TimerAggiornaCountdown); TimerAggiornaCountdown = null; }
    } else
    {
        LampeggioSpia();
        if(TimerLampeggioSpia == null) TimerLampeggioSpia = setInterval(LampeggioSpia, 3000);
        if(TimestampProssimoRiavvio != null) AttivaCountdownRefresh();
    }
}

function LampeggioSpia()
{
    var spia = document.getElementById('SpiaON');
    if(spia != null)
    {
        if(spia.style.backgroundColor == 'firebrick') spia.style.backgroundColor = 'red';
        else if(spia.style.backgroundColor == 'red') spia.style.backgroundColor = 'firebrick';
    }
}

function CaricaImpostazioni()
{
    const ElencoSlotStr = localStorage.getItem(CodiceAgenda + 'ElencoSlot');
    if(ElencoSlotStr != null && ElencoSlotStr != '') ElencoSlot = JSON.parse(ElencoSlotStr);

    const FrequenzaStr = localStorage.getItem(CodiceAgenda + 'Frequenza');
    if(FrequenzaStr != null) CambiamentoFrequenza(Number(FrequenzaStr));

    document.getElementById('PrenotaNuoviSlot').checked = (localStorage.getItem(CodiceAgenda + 'PrenotaNuoviSlot') == 'true');
}

async function ElencaSlot()
{
    var BottoneAvanti = document.querySelector("#calendar > div.fc-toolbar.fc-header-toolbar > div.fc-left > div > button.fc-next-button.fc-button.fc-button-primary");
    var BottoneIndietro = document.querySelector("#calendar > div.fc-toolbar.fc-header-toolbar > div.fc-left > div > button.fc-prev-button.fc-button.fc-button-primary");
    var BottoneOggi = document.querySelector("#calendar > div.fc-toolbar.fc-header-toolbar > div.fc-left > button");
    await BottoneOggi.click();

    const PrenotareDefault = (localStorage.getItem(CodiceAgenda + 'PrenotaNuoviSlot') == 'true');
    var NuovoElencoSlot = [];

    for(var s=0; s <= 13; s++)
    {
        for(var g=0; g<7; g++)
        {
            var t=0;
            while(true)
            {
                var ElemSlot = RestituisciElementoTurno(g, t);
                if(ElemSlot == null) break;
                if(ElemSlot.classList.contains('ag-slot-passed') ) { t++; continue; }

                const DataSlot = GetDataAssoluta(g);
                const OraSlot = ElemSlot.querySelector('div > div.fc-time > span').innerHTML;
                const SlotPrecedente = GetSlot(DataSlot, OraSlot);
                if(SlotPrecedente == null)
                {
                    var suono = new Audio(SuonoNuovoSlotPubblicato);
                    suono.play();
                }

                var ElemTitolo = ElemSlot.querySelector('div > div.fc-title');
                const TitoloSlot = (ElemTitolo != null ? ElemTitolo.innerHTML : '');

                var elem = { data: DataSlot,
                            ora: OraSlot,
                            titolo: TitoloSlot,
                            PostiLiberi: GetPostiLiberi(ElemSlot),
                            capienza: GetPostiTotali(ElemSlot),
                            prenotare: (SlotPrecedente != null ? SlotPrecedente.prenotare : PrenotareDefault),
                            prenotato: ElemSlot.classList.contains('ag-slot-mine'),
                            dataPrenotazione: (SlotPrecedente != null ? SlotPrecedente.dataPrenotazione : null),
                            dataUltimoTentativo: (SlotPrecedente != null ? SlotPrecedente.dataUltimoTentativo : null),
                            IndSettimana: s,
                            IndGiorno: g,
                            IndTurno: t,
                           };
                NuovoElencoSlot.push(elem);

                t++;
            }
        }
        await BottoneAvanti.click();
    }

    ElencoSlot = NuovoElencoSlot;
    localStorage.setItem(CodiceAgenda + 'ElencoSlot', JSON.stringify(ElencoSlot));
    OraUltimoControllo = new Date();

    // Aggiorno lista mostrata nella UI
    var ElemElencoSlot = document.getElementById('ElencoSlot');
    ElemElencoSlot.innerHTML = '';
    for(var i=0; i<ElencoSlot.length; i++)
    {
        const elem = ElencoSlot[i];

        const coloriPosti = ColorePosti(elem.PostiLiberi, elem.capienza);

        var coloreSfondo;
        if(elem.prenotato) coloreSfondo = 'lightgreen';
        else if(elem.prenotare) coloreSfondo = 'yellow';
        else coloreSfondo = 'unset';

        var FineGiornoConPiuSlot = false;
        if(ElencoSlot[i-1] != null && ElencoSlot[i].data.getDate() == ElencoSlot[i-1].data.getDate() &&
           ElencoSlot[i+1] != null && ElencoSlot[i].data.getDate() != ElencoSlot[i+1].data.getDate() ) FineGiornoConPiuSlot = true;

        ElemElencoSlot.innerHTML +=
        `<label id="CasellaSlot` + i + `" style="display: block; padding: 8px 0 8px 8px; margin: 0; background-color: ` + coloreSfondo + `">
            <input type="checkbox" style="vertical-align: top" id="CheckboxSlot` + i + `" ` + (elem.prenotare ? 'checked' : '') + ` />
		    <div style="display: inline-block; max-width: 90%;">` + DaNumeroANomeGiornoSettimana(elem.data.getDay()) + ' ' +
                elem.data.getDate() + ' ' + DaNumeroANomeMese(elem.data.getMonth(), true) + ' ' + elem.ora +
                '<span style="background-color: ' + coloriPosti[0] + '; color: ' + coloriPosti[1] + '; border-radius: 5px; padding: 3px; margin-left: 5px;' +
                    (coloreSfondo != 'unset' ? 'border: 1px solid black;' : '') + '">' +
                    '<span style="font-weight: bold; font-size: 110%">' + elem.PostiLiberi + '</span> liber' + (elem.PostiLiberi != 1 ? 'i' : 'o') +
                    '<span style="font-size: 90%; opacity: 0.8"> su ' + elem.capienza + '</span>' +
                '</span>' +
                (elem.titolo != '' ? '<div style="color: darkviolet; font-weight: bold;">' + elem.titolo + '</div>' : '') +
                (elem.prenotato ? '<div style="font-face: bold; color: green">Prenotato' +
                (elem.dataPrenotazione != null ? 'alle ' + FormattaData(elem.dataPrenotazione) : '') + '</div>' : '') +
            `</div>
        </label>` +
        (FineGiornoConPiuSlot ? '<hr style="margin: 2px 0" />' : '');
    }
    for(i=0; i<ElencoSlot.length; i++) document.getElementById('CheckboxSlot' + i).addEventListener('click', ClickCasellaSlot.bind(null, i));

    if(ElencoSlot.length == 0) document.getElementById('ElencoSlot').innerHTML = `<div style="text-align: center; font-size: 120%; padding: 8px"><div style="font-size: 300%; font-weight: bold; color: gray; font-family: helvetica"></div>Non ho trovato slot prenotabili su questa agenda!</div>`;

    BottoneOggi = document.querySelector("#calendar > div.fc-toolbar.fc-header-toolbar > div.fc-left > button");
    await BottoneOggi.click();
}

async function EseguiPrenotazioni()
{
    var ElencoPrenotazioniNecessarie = [];

    for(var i=0; i < ElencoSlot.length; i++)
    {
        if(ElencoSlot[i].prenotare && !ElencoSlot[i].prenotato && ElencoSlot[i].PostiLiberi > 0)
            { ElencoPrenotazioniNecessarie.push(i); }
    }
    ElencoPrenotazioniNecessarie.sort(OrdinamentoPerTentativoPiLontano);

    for(i=0; i < ElencoPrenotazioniNecessarie.length; i++) await Prenota(ElencoPrenotazioniNecessarie[i]);
}

function OrdinamentoPerTentativoPiLontano(a, b)
{
    const dataA = ElencoSlot[a].dataUltimoTentativo;
    const dataB = ElencoSlot[b].dataUltimoTentativo;

    if(dataA == null) return -1;
    else if(dataB == null) return 1;
    else return (new Date(dataA)).getTime() - (new Date(dataB)).getTime();
}

async function Prenota(indice)
{
    var BottoneAvanti = document.querySelector("#calendar > div.fc-toolbar.fc-header-toolbar > div.fc-left > div > button.fc-next-button.fc-button.fc-button-primary");
    var BottoneOggi = document.querySelector("#calendar > div.fc-toolbar.fc-header-toolbar > div.fc-left > button");

    PrenotazioniInCorso++;
    const ThrobberPrenotazione = '<img alt="attendi..." style="object-fit: cover; height: 25px; width: 40px" height="40" src="data:image/svg+xml;base64," />';
    var OrarioSintetico = ElencoSlot[indice].ora.replace(' - ', '-');
    OrarioSintetico = OrarioSintetico.replace(':00', ''); OrarioSintetico = OrarioSintetico.replace(':00', '');
    Attivit(ThrobberPrenotazione + ' Cerco di prenotare lo slot ' + ElencoSlot[indice].data.getDate() + ' ' + DaNumeroANomeMese(ElencoSlot[indice].data.getMonth(), false) + ' ' + OrarioSintetico);

    //Mi sposto alla settimana giusta
    await BottoneOggi.click();
    for(var i=0; i < ElencoSlot[indice].IndSettimana; i++) await BottoneAvanti.click();

    var elemento = RestituisciElementoTurno(ElencoSlot[indice].IndGiorno, ElencoSlot[indice].IndTurno);

    const TimestampClick = (new Date()).getTime();
    ElencoSlot[indice].dataUltimoTentativo = new Date();
    localStorage.setItem(CodiceAgenda + 'ElencoSlot', JSON.stringify(ElencoSlot));

    await elemento.click();

    // Attendo e verifico che la prenotazione sia stata registrata sul sito Agende
    while(true)
    {
        if(elemento.classList.contains('ag-slot-mine')) //Prenotazione riuscita!
        {
            // Registro nel local storage
            ElencoSlot[indice].prenotato = true;
            ElencoSlot[indice].dataPrenotazione = new Date();
            ElencoSlot[indice].prenotare = false;
            localStorage.setItem(CodiceAgenda + 'ElencoSlot', JSON.stringify(ElencoSlot));

            // Aggiorno UI
            document.getElementById('CheckboxSlot' + indice).checked = false;
            document.getElementById('CasellaSlot' + indice).style.backgroundColor = 'lightgreen';
            document.getElementById('CasellaSlot' + indice).innerHTML += '<div style="font-face: bold; color: green">Prenotato alle ' + FormattaData(new Date() ) + '</div>';
            PrenotazioniInCorso--;

            // Avviso acustico
            var suono = new Audio(SuonoPrenotazioneFatta);
            suono.play();
            return;
        }
        await sleep(500);

        const MsPassati = (new Date()).getTime() - TimestampClick;
        if(MsPassati > 10000)
        {
            if(ElencoSlot[indice].prenotare)
                { await RicaricaPagina('Prenotazione non riuscita'); PrenotazioniInCorso--; return; }
            else { PrenotazioniInCorso--; return; } //Se durante l'attesa e verifica l'utente ha rimosso il suo interesse verso lo slot, non c' bisogno di refreshare per ritentare
        }
    }
}

function CalcolaProssimoRiavvio()
{
    var HoQualcosaDaFare;
    if(localStorage.getItem(CodiceAgenda + 'PrenotaNuoviSlot') == 'true') HoQualcosaDaFare = true;
    else
    {
        HoQualcosaDaFare = false;
        for(var i=0; i < ElencoSlot.length; i++)
        {
            if(ElencoSlot[i].prenotare && !ElencoSlot[i].prenotato) { HoQualcosaDaFare = true; break; }
        }
    }

    if(!HoQualcosaDaFare)
    {
        TimestampProssimoRiavvio = null;

        // Aggiorno UI
        document.getElementById('ON').style.display = 'none';
        document.getElementById('OFF').style.display = 'block';
        document.title = document.title.replace('', '');
        Attivit('Nessun ordine inserito');

        // Cancello timer
        if(TimerProssimoRiavvio != null) { clearTimeout(TimerProssimoRiavvio); TimerProssimoRiavvio = null; }
        if(TimerTieniAggiornataDataRiavvio != null) { clearTimeout(TimerTieniAggiornataDataRiavvio); TimerTieniAggiornataDataRiavvio = null; }
        if(TimerAggiornaCountdown != null) { clearTimeout(TimerAggiornaCountdown); TimerAggiornaCountdown = null; }
    }
    else
    {
        // Aggiorno UI
        if(document.getElementById('ON').style.display == 'none')
        {
            document.title = '' + document.title;
            document.getElementById('ON').style.display = 'block';
            document.getElementById('OFF').style.display = 'none';
        }

        // Calcolo quanto manca; se gi passato, eseguo riavvio
        const frequenzaMs = GetFrequenzaControlliMinuti() * 60000;
        TimestampProssimoRiavvio = OraUltimoControllo.getTime() + frequenzaMs;
        const MsMancanti = TimestampProssimoRiavvio - (new Date()).getTime();

        if(MsMancanti < 0) { RicaricaPagina('Devo eseguire un nuovo controllo'); return; }

        // Aggiorno attivit in corso nella UI, e imposto il suo aggiornamento periodico
        AttivaCountdownRefresh();

        // Imposto timer (sovrascrivendoli se gi esistenti)
        if(TimerProssimoRiavvio != null) clearTimeout(TimerProssimoRiavvio);
        TimerProssimoRiavvio = setTimeout(RicaricaPagina.bind(null, 'Devo eseguire un nuovo controllo'), MsMancanti);

        if(TimerTieniAggiornataDataRiavvio != null) clearTimeout(TimerTieniAggiornataDataRiavvio);
        TimerTieniAggiornataDataRiavvio = setInterval(CalcolaProssimoRiavvio, 60000);
    }
}

function AttivaCountdownRefresh()
{
    const MsMancanti = TimestampProssimoRiavvio - (new Date()).getTime();
    Attivit('Attendo prossimo aggiornamento pagina (tra ' + FormattaLassoTempo(MsMancanti) + ')');

    //Adatto l'intervallo di aggiornamento dell'attivit in corso in base a quanto manca
    var IntervCountdownUI;
    if(MsMancanti < 315000) IntervCountdownUI = 1000; //vengono visualizzati i secondi: necessario aggiornare ogni secondo
    else if(MsMancanti < 600000) IntervCountdownUI = 15000; //vengono visualizzati solo i minuti, posso aggiornare meno spesso
    else IntervCountdownUI = 60000; //vengono visualizzati solo i minuti, posso aggiornare meno spesso

    if(TimerAggiornaCountdown != null) clearTimeout(TimerAggiornaCountdown);
    TimerAggiornaCountdown = setInterval(AggiornaCountdown, IntervCountdownUI);
}

function AggiornaCountdown()
{
    if(PrenotazioniInCorso > 0) return;
    const MsMancanti = TimestampProssimoRiavvio - (new Date()).getTime();
    const MsMancantiFormattati = MsMancanti >= 10000 ? FormattaLassoTempo(MsMancanti) : '<b>' + FormattaLassoTempo(MsMancanti) + '</b>';
    if(MsMancanti > 0) Attivit('Attendo prossimo aggiornamento pagina (tra ' + MsMancantiFormattati + ')');
}

function FormattaLassoTempo(millisecondi)
{
    if(millisecondi < 1000) return '0,' + Math.floor(millisecondi/100) + 's';
    else if(millisecondi < 60000) return Math.floor(millisecondi/1000) + 's';
    else if(millisecondi < 300000) return Math.floor(millisecondi/60000) + '&nbsp;min&nbsp;' + Math.floor((millisecondi % 60000)/1000) + 's';
    else return Math.floor(millisecondi/60000) + '&nbsp;minuti';
}

function FormattaData(data)
{
    return data.getHours() + (data.getMinutes() < 10 ? ':0' : ':') + data.getMinutes() + ' ' + data.getDate() + ' ' + DaNumeroANomeMese(data.getMonth(), false);
}

async function ClickCasellaSlot(indice)
{
    var CheckBox = document.getElementById('CheckboxSlot' + indice);
    var casella = CheckBox.parentElement;
    var IndicatorePosti = casella.querySelector('div > span');

    ElencoSlot[indice].prenotare = CheckBox.checked;
    localStorage.setItem(CodiceAgenda + 'ElencoSlot', JSON.stringify(ElencoSlot));

    if(ElencoSlot[indice].prenotato == true) { casella.style.backgroundColor = 'lightgreen'; IndicatorePosti.style.border = '1px solid black'; }
    else if(ElencoSlot[indice].prenotare == true) { casella.style.backgroundColor = 'yellow'; IndicatorePosti.style.border = '1px solid black'; }
    else { casella.style.backgroundColor = 'unset'; IndicatorePosti.style.border = 'none'; }

    CalcolaProssimoRiavvio();
    await EseguiPrenotazioni();
}

function ClickPrenotaNuoviSlot()
{
    localStorage.setItem(CodiceAgenda + 'PrenotaNuoviSlot', document.getElementById('PrenotaNuoviSlot').checked);
    CalcolaProssimoRiavvio();
}

function CambiamentoFrequenza(ForzaLivello)
{
    var Slider = document.getElementById('FrequenzaSlider');
    var Label = document.getElementById('FrequenzaLabel');
    var livello = (ForzaLivello != null ? ForzaLivello : Slider.value);
    Slider.value = livello;
    if(ForzaLivello == null) localStorage.setItem(CodiceAgenda + 'Frequenza', livello);
    if(ForzaLivello == null) CalcolaProssimoRiavvio();

    if(livello == -3)
    {
        Label.innerHTML = 'ogni ora';
        Label.style.color = '#4de34d';
        Slider.style.background = '#6ee86e';
    } else if(livello == -2)
    {
        Label.innerHTML = 'ogni 20 minuti';
        Label.style.color = '#3EBE00';
        Slider.style.background = '#3EBE00';
    } else if(livello == -1)
    {
        Label.innerHTML = 'ogni 8 minuti';
        Label.style.color = 'green';
        Slider.style.background = 'green';
    } else if(livello == 0)
    {
        Label.innerHTML = 'ogni 3 minuti';
        Label.style.color = '#005CC8';
        Slider.style.background = '#005CC8';
    } else if(livello == 1)
    {
        Label.innerHTML = 'ogni 1 minuto e 30';
        Label.style.color = '#b2b200';
        Slider.style.background = '#FFE118';
    } else if(livello == 2)
    {
        Label.innerHTML = 'ogni 45 secondi';
        Label.style.color = '#FF8100';
        Slider.style.background = '#FF8100';
    } else if(livello == 3)
    {
        Label.innerHTML = 'ogni 15 secondi';
        Label.style.color = '#E10000';
        Slider.style.background = '#E10000';
    }
}

function GetFrequenzaControlliMinuti()
{
    const storage = localStorage.getItem(CodiceAgenda + 'Frequenza');
    if(storage == null) return 5;
    else
    {
        if(Number(storage) == -3) return 60;
        else if(Number(storage) == -2) return 20;
        else if(Number(storage) == -1) return 8;
        else if(Number(storage) == 0) return 3;
        else if(Number(storage) == 1) return 1.5; //1 minuto e 30
        else if(Number(storage) == 2) return 0.75; //45 secondi
        else if(Number(storage) == 3) return 0.25; //15 secondi
    }
}

async function RicaricaPagina(msg)
{
    const throbber = '<img alt="" width="25" height="25" src="data:image/svg+xml;base64," />';
    if(msg == null) Attivit(throbber + 'Ricarico la pagina');
    else Attivit(throbber + msg + ': ricarico la pagina');

    // Ordina il refresh e cicla finch la pagina non si  ricaricata
    while(true)
    {
        window.location.reload();
        await sleep(30000);
    }
}

function GetSlot(DataSlot, OraSlot)
{
    for(var i=0; i<ElencoSlot.length; i++)
    {
        const data = new Date(ElencoSlot[i].data);
        if(data.getTime() == DataSlot.getTime() && ElencoSlot[i].ora == OraSlot) return ElencoSlot[i];
    }
    return null; //non trovato
}

function ColorePosti(liberi, totali)
{
    if(liberi < 0) return ['black', 'white'];
    else if(liberi == 0) return ['darkred', 'white'];
    else if(liberi <= 2) return ['red', 'white'];
    else if((liberi-2) < 0.2*totali) return ['orange', 'black'];
    else if((liberi-2) < 0.52*totali) return ['yellow', 'black'];
    else if((liberi-2) < 0.76*totali) return ['#99DE00', 'black'];
    else if((liberi-2) < 0.92*totali) return ['#00C200', 'white'];
    else return ['#008250', 'white'];
}

function GetPostiLiberi(elemento)
{
    var ElemOccupati = elemento.querySelector('div > div.ag-cnt > span.ag-taken');
    var Totali = GetPostiTotali(elemento);

    if(Totali == 0) return 0;
    else if(ElemOccupati == null || ElemOccupati.innerHTML == '') return '?';
    else return Totali - Number(ElemOccupati.innerHTML);
}

function GetPostiTotali(ElemSlot)
{
    if(ElemSlot.querySelector('div > div.ag-cnt > span.ag-max') != null)
        { return Number(ElemSlot.querySelector('div > div.ag-cnt > span.ag-max').innerHTML); }
    else if(ElemSlot.querySelector('div > div.ag-cnt > input') != null)
        { return Number(ElemSlot.querySelector('div > div.ag-cnt > input').value); }
    else return 0;
}

function GetDataAssoluta(GiornoSettimana)
{
    var RetVal = LunedSettimanaVisualizzata();
    //alert('LunedSettimanaVisualizzata: ' + RetVal);
    RetVal.setDate(RetVal.getDate() + GiornoSettimana);
    //alert('+' + GiornoSettimana + ': ' + RetVal);
    return RetVal;
}

function LunedSettimanaVisualizzata()
{
    const StringaSettimana = document.querySelector("#calendar > div.fc-toolbar.fc-header-toolbar > div.fc-center > h2").innerHTML;
    const StringaDomenica = StringaSettimana.split('  ')[1];
    const giorno = Number(StringaDomenica.split(' ')[0]);
    const meseStringa = StringaDomenica.split(' ')[1];
    const mese = DaNomeANumeroMese(meseStringa) - 1;
    const anno = Number(StringaDomenica.split(' ')[2]);

    var data = new Date(anno, mese, giorno);
    data.setDate(data.getDate() - 6);
    return data;
}

function DaNomeANumeroMese(StringaMese)
{
    if(StringaMese == 'gen') return 1;
    else if(StringaMese == 'feb') return 2;
    else if(StringaMese == 'mar') return 3;
    else if(StringaMese == 'apr') return 4;
    else if(StringaMese == 'mag') return 5;
    else if(StringaMese == 'giu') return 6;
    else if(StringaMese == 'lug') return 7;
    else if(StringaMese == 'ago') return 8;
    else if(StringaMese == 'set') return 9;
    else if(StringaMese == 'ott') return 10;
    else if(StringaMese == 'nov') return 11;
    else if(StringaMese == 'dic') return 12;
}

function DaNumeroANomeMese(NumeroMese, VersioneLunga)
{
    if(VersioneLunga == null) VersioneLunga = false;

    if(NumeroMese == 0) return (VersioneLunga ? 'gennaio' : 'gen');
    else if(NumeroMese == 1) return (VersioneLunga ? 'febbraio' : 'feb');
    else if(NumeroMese == 2) return (VersioneLunga ? 'marzo' : 'mar');
    else if(NumeroMese == 3) return (VersioneLunga ? 'aprile' : 'apr');
    else if(NumeroMese == 4) return (VersioneLunga ? 'maggio' : 'mag');
    else if(NumeroMese == 5) return (VersioneLunga ? 'giugno' : 'giu');
    else if(NumeroMese == 6) return (VersioneLunga ? 'luglio' : 'lug');
    else if(NumeroMese == 7) return (VersioneLunga ? 'agosto' : 'ago');
    else if(NumeroMese == 8) return (VersioneLunga ? 'settembre' : 'set');
    else if(NumeroMese == 9) return (VersioneLunga ? 'ottobre' : 'ott');
    else if(NumeroMese == 10) return (VersioneLunga ? 'novembre' : 'nov');
    else if(NumeroMese == 11) return (VersioneLunga ? 'dicembre' : 'dic');
}

function DaNumeroANomeGiornoSettimana(GiornoSettimana)
{
    if(GiornoSettimana == 0) return 'dom';
    else if(GiornoSettimana == 1) return 'lun';
    else if(GiornoSettimana == 2) return 'mar';
    else if(GiornoSettimana == 3) return 'mer';
    else if(GiornoSettimana == 4) return 'gio';
    else if(GiornoSettimana == 5) return 'ven';
    else if(GiornoSettimana == 6) return 'sab';
}

function Attivit(stringa)
{
    var elem = document.getElementById('attivit');
    if(elem != null) elem.innerHTML = stringa;
}

function CiSonoCaselleNellaSettimana()
{
// Restituisce true se nella settimana visualizzata c' almeno una casella/link (compare almeno una casella/link per prenotarsi), false se  tutta vuota
    for(var i = 0; i < 7; i++)
        { if(RestituisciElementoTurno(i, 0) != null) return true; }
    return false;
}

function RestituisciElementoTurno(GiornoSettimana, Turno)
{
//GiornoSettimana: 0=luned ... 6=domenica
//Turno: 0, 1, 2, 3...
    const NumeroColonna = GiornoSettimana + 2;
    //NumeroColonna: 2=luned ... 8=domenica
    return document.querySelector('#calendar > div.fc-view-container > div > table > tbody > tr > td > div.fc-scroller.fc-time-grid-container > div > ' +
           'div.fc-content-skeleton > table > tbody > tr > td:nth-child(' + NumeroColonna + ') > div > div:nth-child(2) > a:nth-child(' + (Turno+1) + ')');
}

function sleep(ms) {
  return new Promise(resolve => setTimeout(resolve, ms));
}